import React from "react";
import { useNavigate } from "react-router-dom";


export default function Login() {

    const[logincreds,change]=React.useState({username:'',password:''})



    const navigate=useNavigate();

    function handlechange(e){

        change

    }

    function handleclick(){

        navigate('/admin')

    }


    return (
        <>
            <form style={{ width: '50%', marginLeft: 'auto', marginRight: 'auto', marginTop: '80px' }}>
                <div style={{ fontSize: '4rem', textAlign: 'center', fontFamily: 'sans-serif' }}>LOGIN</div>
                <div className="mb-3">
                    <label htmlFor="exampleInputEmail1" className="form-label">Email address</label>
                    <input onChange={handlechange} type="email" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" />
                    <div id="emailHelp" className="form-text">We'll never share your email with anyone else.</div>
                </div>
                <div className="mb-3">
                    <label htmlFor="exampleInputPassword1" className="form-label">Password</label>
                    <input onChange={handlechange} type="password" className="form-control" id="exampleInputPassword1" />
                </div>

                <button onClick={handleclick} className="btn btn-primary">Submit</button>
                <div style={{ display: 'flex', flexDirection: 'row', marginTop:'1rem',width:'30%', marginLeft:'auto', marginRight:'auto', justifyContent:'space-around'}}>
                    <button  className="btn btn-primary">Admin</button>
                    <button  className="btn btn-primary">User</button>
                </div>
            </form>


        </>
    )
}
